/*
 * CelestialBody contains functions for some coordinate transformations but they
 * won't work until the object supplies the functions geocentricLongitude and
 * geocentricLatitude.
 */
function CelestialBody()
{
    this.altitude = function(julianDay, longitude, latitude)
    {
        var delta = this.declination(julianDay);
        var H = siderealTime(julianDay) - longitude - this.rightAscension(julianDay);
        return Math.asin(Math.sin(latitude) * Math.sin(delta) + Math.cos(latitude) * Math.cos(delta) * Math.cos(H));
    };
    
    this.azimuth = function(julianDay, longitude, latitude)
    {
        var delta = this.declination(julianDay);
        var H = siderealTime(julianDay) - longitude - this.rightAscension(julianDay);
        return Math.atan2(Math.sin(H), Math.cos(H) * Math.sin(latitude) - Math.tan(delta) * Math.cos(latitude));
    };
    
    this.declination = function(julianDay)
    {
        var beta = this.geocentricLatitude(julianDay);
        var epsilon = obliquity(julianDay);
        var lambda = this.geocentricLongitude(julianDay);
        return Math.asin(Math.sin(beta) * Math.cos(epsilon) + Math.cos(beta) * Math.sin(epsilon) * Math.sin(lambda));
    };
    
    this.rightAscension = function(julianDay)
    {
        var beta = this.geocentricLatitude(julianDay);
        var epsilon = obliquity(julianDay);
        var lambda = this.geocentricLongitude(julianDay);
        return Math.atan2(Math.sin(lambda) * Math.cos(epsilon) - Math.tan(beta) * Math.sin(epsilon), Math.cos(lambda));
    };
}

/*
 * The function coord calculates helicentric ecliptical coordinates using VSOP87
 * but shouldn't be called directly. Instead call the heliocentic... functions
 * as the save the last result and thus avoid double calculations.
 */
function Planet(name, magnitude)
{
    this.coord = function(variable, julianDay)
    {
        var tau = (julianDay - 2451545.0) / 365250;
        var result = 0
        
        for(var power = 0; power < 6; power++)
        {
            var temp = 0;
            
            for(var i = 0; i < this.terms[variable][power].length; i++)
            {
                var A = this.terms[variable][power][i].A;
                var B = this.terms[variable][power][i].B;
                var C = this.terms[variable][power][i].C;
                temp += A * Math.cos(B + C * tau);
            }
            
            result += temp * Math.pow(tau, power);
        }
        
        return result;
    };
    
    this.geocentricLatitude = function(julianDay)
    {
        var L = this.heliocentricLongitude(julianDay);
        var B = this.heliocentricLatitude(julianDay);
        var R = this.heliocentricRadius(julianDay);
        var L_0 = earth.heliocentricLongitude(julianDay);
        var B_0 = earth.heliocentricLatitude(julianDay);
        var R_0 = earth.heliocentricRadius(julianDay);
        var x = R * Math.cos(B) * Math.cos(L) - R_0 * Math.cos(B_0) * Math.cos(L_0);
        var y = R * Math.cos(B) * Math.sin(L) - R_0 * Math.cos(B_0) * Math.sin(L_0);
        var z = R * Math.sin(B) - R_0 * Math.sin(B_0);
        return Math.atan(z / Math.sqrt(x * x + y * y));
    };
    
    this.geocentricLongitude = function(julianDay)
    {
        var L = this.heliocentricLongitude(julianDay);
        var B = this.heliocentricLatitude(julianDay);
        var R = this.heliocentricRadius(julianDay);
        var L_0 = earth.heliocentricLongitude(julianDay);
        var B_0 = earth.heliocentricLatitude(julianDay);
        var R_0 = earth.heliocentricRadius(julianDay);
        var x = R * Math.cos(B) * Math.cos(L) - R_0 * Math.cos(B_0) * Math.cos(L_0);
        var y = R * Math.cos(B) * Math.sin(L) - R_0 * Math.cos(B_0) * Math.sin(L_0);
        return Math.atan2(y, x);
    };
    
    this.geocentricRadius = function(julianDay)
    {
        var L = this.heliocentricLongitude(julianDay);
        var B = this.heliocentricLatitude(julianDay);
        var R = this.heliocentricRadius(julianDay);
        var L_0 = earth.heliocentricLongitude(julianDay);
        var B_0 = earth.heliocentricLatitude(julianDay);
        var R_0 = earth.heliocentricRadius(julianDay);
        var x = R * Math.cos(B) * Math.cos(L) - R_0 * Math.cos(B_0) * Math.cos(L_0);
        var y = R * Math.cos(B) * Math.sin(L) - R_0 * Math.cos(B_0) * Math.sin(L_0);
        var z = R * Math.sin(B) - R_0 * Math.sin(B_0);
        return Math.sqrt(x * x + y * y + z * z);
    };
    
    this.heliocentricLatitude = function(julianDay)
    {
        if(this.lastLatitude != null && this.lastLatitude.julianDay == julianDay)
        {
            return this.lastLatitude.value;
        }
        
        var latitude = this.coord('B', julianDay);
        this.lastLatitude = {julianDay: julianDay, value: latitude};
        return latitude;
    };
    
    this.heliocentricLongitude = function(julianDay)
    {
        if(this.lastLongitude != null && this.lastLatitude.julianDay == julianDay)
        {
            return this.lastLongitude.value;
        }
        
        var longitude = this.coord('L', julianDay);
        this.lastLongitude = {julianDay: julianDay, value: longitude};
        return longitude;
    };
    
    this.heliocentricRadius = function(julianDay)
    {
        if(this.lastRadius != null && this.lastLatitude.julianDay == julianDay)
        {
            return this.lastRadius.value;
        }
        
        var radius = this.coord('R', julianDay);
        this.lastRadius = {julianDay: julianDay, value: radius};
        return radius;
    };
    
    this.lastLatitude = null;
    this.lastLongitude = null;
    this.lastRadius = null;
    this.name = name;
    this.magnitude = magnitude;
}

Planet.prototype = new CelestialBody();

/*
 * Sun
 */
function Sun()
{
    this.geocentricLatitude = function(julianDay)
    {
        return -earth.heliocentricLatitude(julianDay);
    };
    
    this.geocentricLongitude = function(julianDay)
    {
        return earth.heliocentricLongitude(julianDay) + Math.PI;
    };
    
    this.geocentricRadius = function(julianDay)
    {
        return earth.heliocentricRadius(julianDay);
    };
    
    this.name = 'Sonne';
}

