/*
 * Stars
 */
function Star(alpha_0, delta_0, magnitude, name)
{
    this.alpha_0 = alpha_0;
    
    this.declination = function(julianDay)
    {
        var t = (julianDay - 2451545.0) / 36525;
        var zeta = toRadians((2306.2181 * t + 0.30188 * t * t + 0.017998 * t * t * t) / 3600);
        var theta = toRadians((2004.3109 * t - 0.42665 * t * t - 0.041833 * t * t * t) / 3600);
        var C = Math.sin(theta) * Math.cos(delta_0) * Math.cos(alpha_0 + zeta) + Math.cos(theta) * Math.sin(delta_0);
        return Math.asin(C);
    };
    
    this.delta_0 = delta_0;
    this.magnitude = magnitude;
    this.name = name;
    
    this.rightAscension = function(julianDay)
    {
        var t = (julianDay - 2451545.0) / 36525;
        var zeta = toRadians((2306.2181 * t + 0.30188 * t * t + 0.017998 * t * t * t) / 3600);
        var z = toRadians((2306.2181 * t + 1.09468 * t * t + 0.018203 * t * t * t) / 3600);
        var theta = toRadians((2004.3109 * t - 0.42665 * t * t - 0.041833 * t * t * t) / 3600);
        var A = Math.cos(delta_0) * Math.sin(alpha_0 + zeta);
        var B = Math.cos(theta) * Math.cos(delta_0) * Math.cos(alpha_0 + zeta) - Math.sin(theta) * Math.sin(delta_0);
        return Math.atan2(A, B) + z;
    };
}

