/*
 * Base 10 logarithm
 */
function log10(x)
{
    return Math.log(x) / Math.log(10);
}

/*
 * Obliquity of the ecliptic
 */
function obliquity(julianDay)
{
    var U = (julianDay - 2451545.0) / 3652500;
    var epsilon = 84381.448;
    epsilon -= 4680.93 * U;
    epsilon -= 1.55 * U * U;
    epsilon += 1999.25 * U * U * U;
    epsilon -= 51.38 * U * U * U * U;
    epsilon -= 249.67 * U * U * U * U * U;
    epsilon -= 39.05 * U * U * U * U * U * U;
    epsilon += 7.12 * U * U * U * U * U * U * U;
    epsilon += 27.87 * U * U * U * U * U * U * U * U;
    epsilon += 5.79 * U * U * U * U * U * U * U * U * U;
    epsilon += 2.45 * U * U * U * U * U * U * U * U * U * U;
    return toRadians(epsilon / 3600);
}

/*
 * Sidereal time in Greenwich
 */
function siderealTime(julianDay)
{
    var T = (julianDay - 2451545.0) / 36525;
    return toRadians(280.46061837 + 360.98564736629 * (julianDay - 2451545.0) + 0.000387933 * T * T - T * T * T / 38710000);
}

/*
 * Radians to degrees
 */
function toDegrees(radians)
{
    return 180 * radians / Math.PI;
}

/*
 * Julian day number
 * Assumes a proleptic gregorian calendar where the year 1 is preceded by the
 * year 0.
 */
function toJulianDay(year, month, day, hours, minutes, seconds)
{
    day += hours / 24 + minutes / 1440 + seconds / 86400;
    
    if(month <= 2)
    {
        year -= 1;
        month += 12;
    }
    
    var A = Math.floor(year / 100);
    var B = 2 - A + Math.floor(A / 4);
    return Math.floor(365.25 * (year + 4716)) + Math.floor(30.6001 * (month + 1)) + day + B - 1524.5;
}

/*
 * Degrees to radians
 */
function toRadians(degrees)
{
    return Math.PI * degrees / 180;
}

/*
 * Calculations of planetary magnitudes as seen from earth
 */
function mercurianMagnitude(julianDay)
{
    var r = this.heliocentricRadius(julianDay);
    var Delta = this.geocentricRadius(julianDay);
    var R = earth.heliocentricRadius(julianDay);
    var i = toDegrees(Math.acos((r * r + Delta * Delta - R * R) / (2 * r * Delta)));
    return -0.42 + 5 * log10(r * Delta) + 0.0380 * i - 0.000273 * i * i + 0.000002 * i * i * i;
}

// http://en.wiktionary.org/wiki/Cytherean
function cythereanMagnitude(julianDay)
{
    var r = this.heliocentricRadius(julianDay);
    var Delta = this.geocentricRadius(julianDay);
    var R = earth.heliocentricRadius(julianDay);
    var i = toDegrees(Math.acos((r * r + Delta * Delta - R * R) / (2 * r * Delta)));
    return -4.40 + 5 * log10(r * Delta) + 0.0009 * i + 0.000239 * i * i - 0.00000065 * i * i * i;
}

function martianMagnitude(julianDay)
{
    var r = this.heliocentricRadius(julianDay);
    var Delta = this.geocentricRadius(julianDay);
    var R = earth.heliocentricRadius(julianDay);
    var i = toDegrees(Math.acos((r * r + Delta * Delta - R * R) / (2 * r * Delta)));
    return -1.52 + 5 * log10(r * Delta) + 0.016 * i;
}

function jovianMagnitude(julianDay)
{
    var r = this.heliocentricRadius(julianDay);
    var Delta = this.geocentricRadius(julianDay);
    var R = earth.heliocentricRadius(julianDay);
    var i = toDegrees(Math.acos((r * r + Delta * Delta - R * R) / (2 * r * Delta)));
    return -9.40 + 5 * log10(r * Delta) + 0.005 * i;
}

function saturnianMagnitude(julianDay)
{
    var r = this.heliocentricRadius(julianDay);
    var Delta = this.geocentricRadius(julianDay);
    var T = (julianDay - 2451545.0) / 36525;
    var i = toRadians(28.075216 - 0.012998 * T + 0.000004 * T * T);
    var Omega = toRadians(169.508470 + 1.394681 * T + 0.000412 * T * T);
    var lambda = this.geocentricLongitude(julianDay);
    var beta = this.geocentricLatitude(julianDay);
    var B = Math.asin(Math.sin(i) * Math.cos(beta) * Math.sin(lambda - Omega) - Math.cos(i) * Math.sin(beta));
    return -8.88 + 5 * log10(r * Delta) + 0.044 * Math.abs(toDegrees(i)) - 2.60 * Math.sin(Math.abs(B)) + 1.25 * Math.pow(Math.sin(B), 2);
}

function uranianMagnitude(julianDay)
{
    var r = this.heliocentricRadius(julianDay);
    var Delta = this.geocentricRadius(julianDay);
    return -7.19 + 5 * log10(r * Delta);
}

function neptunianMagnitude(julianDay)
{
    var r = this.heliocentricRadius(julianDay);
    var Delta = this.geocentricRadius(julianDay);
    return -6.87 + 5 * log10(r * Delta);
}

